<?php $__env->startSection('content'); ?><p>She's spent the coronavirus lockdown with fiancé Jason Statham and their three-year-old son Jack.</p>

<p>And it appears that Rosie Huntington-Whiteley is missing the catwalk life as she took to Instagram on Tuesday to model no less than nine different outfits.</p>

<p>The model, 33, showed off her style credentials as she posed for a series of glam mirror selfies, much to the delight of her fans. </p>

<p>Model behaviour: It appears that Rosie Huntington-Whiteley is missing the catwalk life as she took to Instagram on Tuesday to model no less than nine different outfits</p>

<p>Rosie was clearly in the mood to showcase her extensive wardrobe as she rocked seven stylish ensembles on her Instagram stories, before taking to her grid with a further two. </p>

<p>Among the outfits modelled, Rosie showcased her slender pins in a khaki mini dress, which she paired with gold heels, a tan clutch bag and dark sunglasses.</p>

<p>While she also stunned in a cream wrap dress, accessorising with a tan belt, sand coloured heels and a chic handbag. </p>

<p>Leggy display: The model, 33, showed off her style credentials as she posed for a series of glam mirror selfies, much to the delight of her fans</p>

<p>The beauty also oozed glamour in an array of black numbers, including a wide-legged trousers and tank top combo, a maxi dress and a thigh-skimming mini dress. </p>

<p>While the beauty wowed with stylish cream outfits, with Rosie displaying her incredible figure in a sleek shift dress before slipping into a loose-fitting shirt and cropped white trousers. </p>

<p>The actress wasn't done there as she then took to her grid where she once again showed off her phenomenal style with a further two looks. </p>

<p>All black everything: The beauty also oozed glamour in an array of black numbers, including a wide-legged trousers and tank top combo, a maxi dress and a thigh-skimming mini dress</p>

<p>Looking good: Rosie got her legs out as she tried on a black mini dress, which she paired with black sliders, a clutch bag and dark shades</p>

<p>This time she donned a tan trench coat, which she paired with a crisp white shirt, indigo jeans, a brown fluffy handbag and simple heels.</p>

<p>While her other ensemble consisted of a baggy cream shirt, blue jeans and a tan bag with matching heels. </p>

<p>Rosie took part in a candid Q&amp;A session earlier in the year, revealing all about life during lockdown with her family. </p>

<p>Among the highlights of her sharing, the blonde bombshell revealed how she first met Jason, that they want more children and that she is proud their son has a 'proper' English accent despite living in the US.</p>

<p>Cream of the crop: The beauty wowed with stylish cream outfits, with Rosie displaying her incredible figure in a sleek shift dress before slipping into a loose-fitting shirt and cropped white trousers</p>

<p>Work it: The actress wasn't done there as she then took to her grid where she once again showed off her phenomenal style with a further two looks</p>

<p>Talking about Jason, she divulged: 'We met at a party in London in 2009! It was instant chemistry,' Rosie wrote over a picture of Jason trying on clothes in a fitting room.</p>

<p>The couple started dating in 2010 and got engaged in 2016 before welcoming Jack in 2017.</p>

<p>Meanwhile, the media personality gave an update on her son Jack saying he's doing 'great' amid the current pandemic.</p>

<p>She wrote: 'We are lucky to be enjoying lots of family time together at the moment.'</p>

